interface IconProps {
    name: string
}

const icons = [
    {
        name: 'arrow',
        width: 12,
        height: 12,
        viewBox: 'string',
        path: 'asdf',
    },
]

export type IconName = typeof icons[]

export const Icon = ({name}: IconProps) => {
    const icon = icons.find(item => item.name === name && item);
    return icon && (
        <svg width={icon.width} height={icon.height} viewBox={icon.viewBox} xmlns="http://www.w3.org/2000/svg">
            <path d={icon.path}/>
        </svg>
    )
}
